import React from 'react';
import { Button, styled, Stack, Link } from '@mui/material';
import { Link as DomLink } from "react-router-dom";

const ColorButton = styled(Button)(({ theme }) => ({
    color: 'black',
    font: 'bold',
    fontSize: '1.5rem',
    fontWeight: 'bold',
    fontFamily: 'Bitter',
    '&:hover': {
        background: "rgb(0, 206, 209,.3)",
        variant: 'outlined',
        focusRipple: true,
    },
}));

export default function NavButtons(from) {
    if (from === 'random') {
        return (
            <>
                <Stack
                    direction="row"
                    spacing={2}
                    alignItems="flex-end">
                    <Link to='/author'>
                        <ColorButton>
                            Author
                        </ColorButton>
                    </Link>
                    <Link to='/category'>
                        <ColorButton>
                            Category
                        </ColorButton>
                    </Link>
                </Stack>
            </>
        )
    }
    else if (from === 'author') {
        return (
            <>
                <Stack
                    direction="row"
                    spacing={2}
                    alignItems="flex-end">
                    <Link to='/random'>
                        <ColorButton>
                            Random
                        </ColorButton>
                    </Link>
                    <Link to='/category'>
                        <ColorButton>
                            Category
                        </ColorButton>
                    </Link>
                </Stack>
            </>
        )
    }
    else if (from === 'category') {
        return (
            <>
                <Stack
                    direction="row"
                    spacing={2}
                    alignItems="flex-end">
                    <Link to='/random'>
                        <ColorButton>
                            Random
                        </ColorButton>
                    </Link>
                    <Link to='/author'>
                        <ColorButton>
                            Author
                        </ColorButton>
                    </Link>
                </Stack>
            </>
        )
    }
    else {
        return (
            <>
                <Stack
                    direction="row"
                    spacing={2}
                    alignItems="flex-end">
                    <Link component="button"
                        variant="body2"
                        onClick={() => {
                            console.info("I'm a button.");
                        }}>
                        <ColorButton>
                            Random
                        </ColorButton>
                    </Link>
                    <Link to='/author'>
                        <ColorButton>
                            Author
                        </ColorButton>
                    </Link>
                    <Link to='/category'>
                        <ColorButton>
                            Category
                        </ColorButton>
                    </Link>
                </Stack>
            </>
        )
    }
}
export function LandingButtons() {

}
